import React, {useEffect, useState} from 'react';
import {Link} from 'react-router-dom';
import Nav from './Nav'; 
import axios from 'axios';

function AdminHome(){
    const [isFormIncomplete, setIsFormIncomplete] = useState(true);
      const [status, setStatus] = useState([]);
      useEffect( () => {
          fetch('http://localhost:4000/fbstatus') 
              .then(res => {
                  return res.json();
              })
              .then(data => {
                  setStatus(data)
              })
      }, []);

      const handleIn = (e) => {
        e.persist();
        e.preventDefault();

                axios.post('http://localhost:4000/update-set-instock')
                .then( res => {
                    alert('Status changed')
                    window.location.reload();

                })
                .catch((error) => {
                    alert('Error please ask staff for help');
                });
       }

       const handleOut = (e) => {
        e.persist();
        e.preventDefault();

                axios.post('http://localhost:4000/update-set-outstock')
                .then( res => {
                    alert('Status changed')
                    window.location.reload();

                })
                .catch((error) => {
                    alert('Error please ask staff for help');
                });
       }


    return(

        <body >
            <Nav/>
            <section class="bg-light text-dark p-5 text-center">
            <h1>Admin Home Page</h1>
            <section class="p-5">
                        <div class="container">
                            <div class="row text-center">
                                <div class="col-md">
                                    <div class="card text-center">
                                        <div class="card-header">
                                            Forms
                                        </div>
                                        <div class="card-body">

                                        <div class="btn-group-vertical" role="group" aria-label="Vertical button group">

                                                <Link to="/allforms" className="btn btn-secondary">All Forms</Link>
                                                <Link to="/submittedforms" className="btn btn-secondary">Submitted Forms</Link>
                                               <Link to="/approvedforms" className="btn btn-secondary ">Approved Forms</Link>
                                                <Link to="/activeforms" className="btn btn-secondary">Active Forms</Link>
                                                <Link to="/completedforms" className="btn btn-secondary">Completed Forms</Link>
                                               <Link to="/incompleteforms" className="btn btn-secondary">Incomplete Forms</Link>
                                                <Link to="/loggedforms" className="btn btn-secondary">Logged Forms</Link>


                                        </div>


                                        </div>
                                        <div class="card-footer text-body-secondary">
                                            UOSU Food Bank
                                        </div>
                                    </div>
                                </div>
                                <div class="col-md">
                                    <div class="card text-center">
                                        <div class="card-header">
                                            Items
                                        </div>
                                        <div class="card-body">
                                        <div class="btn-group-vertical" role="group">



                                            <li><Link to="/allitems" className="btn">All Items</Link></li>
                                            <li><Link to="/itemsin" className="btn">Items In stock</Link></li>
                                            <Link to="/itemsout" className="btn">Items Out of stock</Link>
                                            <Link to="/additem" className="btn">Add Item</Link>



                                        </div>

                                        </div>
                                        <div class="card-footer text-body-secondary">
                                            UOSU Food bank
                                        </div>
                                    </div>
                                </div>
                                <div class="col-md">
                                    <div class="card text-center">
                                        <div class="card-header">
                                        {
                                            status.map((status, index) => (
                                                <section >Current Food bank status: {status.fbstatus}</section>
                                            ))
                                        }

                                        </div>
                                        <div class="card-body">

                                            <button type="button" class="btn btn-success" onClick={handleIn} style={{marginRight: '20px'}}>
                                            In Stock
                                            </button>
                                            <button type="button" class="btn btn-danger" onClick={handleOut}>
                                            Out of Stock
                                            </button>




                                        </div>
                                        <div class="card-footer text-body-secondary">
                                            UOSU Food bank
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </section>
            </section>
        </body>

    );
}

export default AdminHome;
